func TestEstimatorCommonDebug(t *testing.T) {
	t.SkipNow()
	for _, test := range []struct {
		comment string
		source  string
		v1      int
		v2      int
		v3      int
	}{
		{`V4: ARHXYD7j7chYAze2gwH4J3h7HLpHpiBxufnJo6YeqTvQ reduced`, "", 1651, 1660, 1571},
	} {
		src, err := base64.StdEncoding.DecodeString(test.source)
		require.NoError(t, err, test.comment)

		tree, err := Parse(src)
		require.NoError(t, err, test.comment)
		assert.NotNil(t, tree, test.comment)

		start := time.Now()
		e, err := EstimateTree(tree, 3)
		require.NoError(t, err, test.comment)
		assert.Equal(t, test.v3, e.Estimation, test.comment)
		fmt.Println(test.comment, ":", time.Since(start))
	}
}

func TestStackOverflowOnV2(t *testing.T) {
	for _, test := range []struct {
		comment string
		source  string
		v1      int
		v2      int
		v3      int
	}{
		{"stack overflow 1 on V2", "", 3718, 3418, 2679},
		{"stack overflow 2 on V2", "", 3523, 3223, 2520},
	} {
		src, err := base64.StdEncoding.DecodeString(test.source)
		require.NoError(t, err, test.comment)
		tree, err := Parse(src)
		require.NoError(t, err, test.comment)
		assert.NotNil(t, tree, test.comment)

		start := time.Now()
		e, err := EstimateTree(tree, 2)
		require.NoError(t, err, test.comment)
		assert.Equal(t, test.v2, e.Estimation, test.comment)
		fmt.Println(test.comment, ":", time.Since(start))
	}
}

func TestFailOnInvocationInExpression(t *testing.T) {
	/*
		{-# STDLIB_VERSION 5 #-}
		{-# CONTENT_TYPE EXPRESSION #-}
		{-# SCRIPT_TYPE ACCOUNT #-}

		let dapp = Address(base58'3P8eZVKS7a4troGckytxaefLAi9w7P5aMna')

		match tx {
		    case t: InvokeScriptTransaction => {
		        let result = match invoke(dapp, "foo", [5], [AttachedPayment(unit, 10)]) {
		            case i: Int => i
		            case _ => throw("Wrong result type")
		        }
		        if result == 5 then true else throw("Wrong result '" + result.toString() + "'")
		    }
		    case _ => throw("Wrong tx type")
		}
	*/
	source := ""
	src, err := base64.StdEncoding.DecodeString(source)
	require.NoError(t, err)

	tree, err := Parse(src)
	require.NoError(t, err)
	assert.NotNil(t, tree)

	_, err = EstimateTree(tree, 3)
	require.Error(t, err)
}
